Weekend REWIND:

She might as well have just said;

"Look, we live in the big cities on the East and West Coasts. There's a reason we call "flyover country" flyover country. Who wants to spend any time in Missouri or Arkansas? I sure don't let me tell you. Nothing but a bunch of redneck hicks who if they are lucky might stumble their way into the local state college. State college. If they are lucky. No, here on the coasts we love our government. And being packed into cities. And high taxes. And gun laws that disarm the local population. And the welfare state. We are the people who know "it takes a village." Those people in Nebraska and Tennessee? Well let's just say that we are happy to take their resources. But they had better keep their mouths shut. Am I right?"

From the article;

"Eliminating the welfare-warfare state is the key to protecting our free speech, and other liberties, from an authoritarian government."

So true.

Or how about this honest to goodness slogan from Pyongyang;

"Fertilizer means rice and socialism."

Awesome, and at least half right.
